module.exports = "---\ntitle: Composant React Table\ncomponents: Table, TableBody, TableCell, TableContainer, TableFooter, TableHead, TablePagination, TableRow, TableSortLabel\n---\n\n# Table (Tableaux)\n\n<p class=\"description\">Tables display sets of data. They can be fully customized.</p>\n\n[Tables](https://material.io/design/components/data-tables.html) display information in a way thats easy to scan, so that users can look for patterns and insights. Ils peuvent tre intgrs au contenu principal, tel que les cartes.\n\nTables can include:\n\n- Une visualisation correspondante\n- Menu principal\n- Outils pour interroger et manipuler des donnes\n\nLorsque des outils sont inclus, ils doivent tre placs directement au-dessus ou au-dessous de la table.\n\n## Structure\n\nUne table de donnes contient en haut une ligne den-tte qui rpertorie les noms de colonne, suivis de lignes pour les donnes.\n\nDes cases  cocher doivent accompagner chaque ligne si l'utilisateur doit slectionner ou manipuler des donnes.\n\nPour l'accessibilit, la premire colonne est dfinie comme un lment `<th>` , avec un `scope` de `\"row\"`. Cela permet aux lecteurs d'cran d'identifier la valeur d'une cellule par son nom de ligne et de colonne.\n\n## Tableau simple\n\nUn exemple simple et sans fioritures.\n\n{{\"demo\": \"pages/components/tables/SimpleTable.js\", \"bg\": true}}\n\n## Tableau dense\n\nUn exemple simple de tableau dense sans fioritures.\n\n{{\"demo\": \"pages/components/tables/DenseTable.js\", \"bg\": true}}\n\n## Tri & Slection\n\nCet exemple illustre l'utilisation de `Checkbox` et des lignes cliquables pour la slection, avec une `Toolbar` personnalise. Il utilise le composant `TableSortLabel` pour aider  styliser les en-ttes de colonne.\n\nLa table a reu une largeur fixe pour illustrer le dfilement horizontal. Afin d'viter le dfilement des contrles de pagination, le composant TablePagination est utilis en dehors du tableau. (L'exemple ['Action de pagination de table personnalise' ](#custom-table-pagination-action) ci-dessous montre la pagination dans TableFooter.)\n\n{{\"demo\": \"pages/components/tables/EnhancedTable.js\", \"bg\": true}}\n\n## Tableaux Personnaliss\n\nVoici un exemple de personnalisation du composant. Vous pouvez en savoir plus dans la [page de documentation des overrides](/customization/components/).\n\n{{\"demo\": \"pages/components/tables/CustomizedTables.js\", \"bg\": true}}\n\n### Custom pagination options\n\nIt's possible to customise the options shown in the \"Rows per page\" select using the `rowsPerPageOptions` prop. You should either provide an array of:\n\n- **numbers**, each number will be used for the option's label and value.\n    \n    ```jsx\n    <TablePagination rowsPerPageOptions={[10, 50]} />\n    ```\n\n- **objects**, the `value` and `label` keys will be used respectively for the value and label of the option (useful for language strings such as 'All').\n    \n    ```jsx\n    <TablePagination rowsPerPageOptions={[10, 50, { value: -1, label: 'All' }]} />\n    ```\n\n### Custom pagination actions\n\nLa proprit `Action` du composant `TablePagination` permet l'implmentation d'actions personnalises.\n\n{{\"demo\": \"pages/components/tables/CustomPaginationActionsTable.js\", \"bg\": true}}\n\n## Fixed header\n\nAn example of a table with scrollable rows and fixed column headers. It leverages the `stickyHeader` prop ( no IE 11 support).\n\n{{\"demo\": \"pages/components/tables/StickyHeadTable.js\", \"bg\": true}}\n\n## Spanning Table\n\nUn exemple simple avec des colonnes couvrant & lignes.\n\n{{\"demo\": \"pages/components/tables/SpanningTable.js\", \"bg\": true}}\n\n## Table virtualise\n\nDans l'exemple suivant, nous montrons comment utiliser [react-virtualized](https://github.com/bvaughn/react-virtualized) avec le composant `Table`. Il affiche 200 lignes et peut facilement grer plus. La virtualisation aide  rsoudre les problmes de performances.\n\n{{\"demo\": \"pages/components/tables/ReactVirtualizedTable.js\", \"bg\": true}}\n\n## Projets complmentaires\n\nPour des cas d'utilisation plus avancs, vous pourrez peut-tre tirer parti des projects suivants:\n\n### material-table\n\n![stars](https://img.shields.io/github/stars/mbrn/material-table.svg?style=social&label=Stars) ![npm downloads](https://img.shields.io/npm/dm/material-table.svg)\n\n[material-table](https://github.com/mbrn/material-table) est une table de donnes simple et puissante pour React bas sur les tables Material-UI avec quelques fonctionnalits supplmentaires. Ils prennent en charge de nombreux cas d'utilisation diffrents (ditable, filtrage, regroupement, tri, slection, i18n, donnes arborescentes, etc.). Vous devriez y jeter un coup d'oeil.\n\n{{\"demo\": \"pages/components/tables/MaterialTableDemo.js\", \"bg\": true}}\n\n### Autres\n\n- [dx-react-grid-material-ui](https://devexpress.github.io/devextreme-reactive/react/grid/): A data grid for Material-UI with paging, sorting, filtering, grouping and editing features ([paid license](https://js.devexpress.com/licensing/)).\n- [mui-datatables](https://github.com/gregnb/mui-datatables): Responsive data tables for Material-UI with filtering, sorting, search and more.\n- [tubular-react](https://github.com/unosquare/tubular-react): A Material-UI table with local or remote data-source. Featuring filtering, sorting, free-text search, export to CSV locally, and aggregations.\n\n## Accessibilit\n\n(WAI tutorial: https://www.w3.org/WAI/tutorials/tables/)\n\n### Caption\n\nA caption functions like a heading for a table. Most screen readers announce the content of captions. Captions help users to find a table and understand what its about and decide if they want to read it.\n\n{{\"demo\": \"pages/components/tables/AcccessibleTable.js\", \"bg\": true}}"

