module.exports = "---\ntitle: Table React-Komponente\ncomponents: Table, TableBody, TableCell, TableContainer, TableFooter, TableHead, TablePagination, TableRow, TableSortLabel\n---\n\n# Table (tabelle)\n\n<p class=\"description\">Tabellen zeigen Datenstze an. Sie knnen vollstndig angepasst werden.</p>\n\n[Tables](https://material.io/design/components/data-tables.html) display information in a way thats easy to scan, so that users can look for patterns and insights. Sie knnen wie Karten in den Primr-Inhalt eingebettet werden.\n\nTabellen knnen beinhalten:\n\n- Eine entsprechende Visualisierung\n- Navigation\n- Werkzeuge um Daten abzufragen und zu manipulieren\n\nWenn Sie Werkzeuge einbinden, sollten diese direkt ber oder unter der Tabelle platziert werden.\n\n## Struktur\n\nEine Daten-Tabelle enthlt oben eine Kopfzeile, welche die Spaltennamen auflistet, gefolgt von den Zeilen fr Daten.\n\nJede Zeile sollte ein Optionsfeld begleiten, falls die Nutzer die Daten auswhlen oder ndern mssen.\n\nFr die Zugnglichkeit, ist die erste Spalte ein `<th>` Element, welches ein `scope` von `\"row\"` hat. Dies ermglicht es Lesern, mithilfe von Zeilen- und Spaltenname den Inhalt einer Zelle zu ermitteln.\n\n## Einfache Tabelle\n\nEin einfaches Beispiel ohne Verzierungen.\n\n{{\"demo\": \"pages/components/tables/SimpleTable.js\", \"bg\": true}}\n\n## Dichte Tabelle\n\nEin einfaches Beispiel fr einen dichte Tabelle ohne Schnrkel.\n\n{{\"demo\": \"pages/components/tables/DenseTable.js\", \"bg\": true}}\n\n## Sortieren & Auswahl\n\nDieses Beispiel demonstriert die Nutzung von `Optionsfeld` und klickbaren Zeilen zur Auswahl mit einer benutzerdefinierten `Werkzeugleiste`. Es verwendet die `TableSortLabel` Komponente, um Spaltenberschriften zu formatieren.\n\nDer Tabelle wurde eine feste Breite zugewiesen, um das horizontale Scrollen zu veranschaulichen. Um zu verhindern, dass die Paginierungssteuerelemente einen Bildlauf ausfhren, wird die TablePagination-Komponente auerhalb der Tabelle verwendet. (Das [Custom Tabelle Paginierung Aktion Beispiel](#custom-table-pagination-action) unten zeigt die Paginierung im TableFooter.)\n\n{{\"demo\": \"pages/components/tables/EnhancedTable.js\", \"bg\": true}}\n\n## Benutzerdefinierte Tabellen\n\nHier ist ein Beispiel zum Anpassen der Komponente. Mehr dazu erfahren Sie auf der [berschreibungsdokumentationsseite](/customization/components/).\n\n{{\"demo\": \"pages/components/tables/CustomizedTables.js\", \"bg\": true}}\n\n### Custom pagination options\n\nIt's possible to customise the options shown in the \"Rows per page\" select using the `rowsPerPageOptions` prop. You should either provide an array of:\n\n- **numbers**, each number will be used for the option's label and value.\n    \n    ```jsx\n    <TablePagination rowsPerPageOptions={[10, 50]} />\n    ```\n\n- **objects**, the `value` and `label` keys will be used respectively for the value and label of the option (useful for language strings such as 'All').\n    \n    ```jsx\n    <TablePagination rowsPerPageOptions={[10, 50, { value: -1, label: 'All' }]} />\n    ```\n\n### Custom pagination actions\n\nDie Eigenschaft `Action` der Komponente `TablePagination` ermglicht die Implementierung von benutzerdefinierten Aktionen.\n\n{{\"demo\": \"pages/components/tables/CustomPaginationActionsTable.js\", \"bg\": true}}\n\n## Fixed header\n\nAn example of a table with scrollable rows and fixed column headers. It leverages the `stickyHeader` prop ( no IE 11 support).\n\n{{\"demo\": \"pages/components/tables/StickyHeadTable.js\", \"bg\": true}}\n\n## berspannende Tabellen\n\nEin einfaches Beispiel mit berspannenden Zeilen & Spalten.\n\n{{\"demo\": \"pages/components/tables/SpanningTable.js\", \"bg\": true}}\n\n## Virtualisierte Tabelle\n\nIm folgenden Beispiel zeigen wir wie Sie [react-virtualized](https://github.com/bvaughn/react-virtualized) mit der `Table<` Komponente nutzen knnen. Sie zeigt 200 Zeilen an und kann auch einfach mehr verwalten. Virtualisierung hilft bei Leistungsproblemen.\n\n{{\"demo\": \"pages/components/tables/ReactVirtualizedTable.js\", \"bg\": true}}\n\n## Ergnzende Projekte\n\nFr fortgeschrittenere Anwendungsflle knnen Ihnen folgende Projekte helfen:\n\n### material-table\n\n![stars](https://img.shields.io/github/stars/mbrn/material-table.svg?style=social&label=Stars) ![npm downloads](https://img.shields.io/npm/dm/material-table.svg)\n\n[Material-Table](https://github.com/mbrn/material-table) ist ein einfache und leistungsfhige Daten Tabelle fr React basierend auf Material-UI Table mit einigen zustzlichen Funktionen. Sie untersttzen viele verschiedene Anwendungsflle (editierbar, filtern, gruppieren, sortieren, auswhlen, i18n, Baumdaten und mehr). Sie sollten es sich mal angucken.\n\n{{\"demo\": \"pages/components/tables/MaterialTableDemo.js\", \"bg\": true}}\n\n### Sonstiges\n\n- [dx-react-grid-material-ui](https://devexpress.github.io/devextreme-reactive/react/grid/): A data grid for Material-UI with paging, sorting, filtering, grouping and editing features ([paid license](https://js.devexpress.com/licensing/)).\n- [mui-datatables](https://github.com/gregnb/mui-datatables): Responsive data tables for Material-UI with filtering, sorting, search and more.\n- [tubular-react](https://github.com/unosquare/tubular-react): A Material-UI table with local or remote data-source. Featuring filtering, sorting, free-text search, export to CSV locally, and aggregations.\n\n## Barrierefreiheit\n\n(WAI tutorial: https://www.w3.org/WAI/tutorials/tables/)\n\n### Caption\n\nA caption functions like a heading for a table. Most screen readers announce the content of captions. Captions help users to find a table and understand what its about and decide if they want to read it.\n\n{{\"demo\": \"pages/components/tables/AcccessibleTable.js\", \"bg\": true}}"

