module.exports = "---\ntitle: Table React component\ncomponents: Table, TableBody, TableCell, TableContainer, TableFooter, TableHead, TablePagination, TableRow, TableSortLabel\n---\n\n# Table\n\n<p class=\"description\">Tables display sets of data. They can be fully customized.</p>\n\n[Tables](https://material.io/design/components/data-tables.html) display information in a way thats easy to scan, so that users can look for patterns and insights. They can be embedded in primary content, such as cards.\n\nTables can include:\n\n- A corresponding visualization\n- Navigation\n- Tools to query and manipulate data\n\nWhen including tools, they should be placed directly above or below the table.\n\n## Structure\n\nA data table contains a header row at the top that lists column names, followed by rows for data.\n\nCheckboxes should accompany each row if the user needs to select or manipulate data.\n\nFor accessibility, the first column is set to be a `<th>` element, with a `scope` of `\"row\"`. This enables screen readers to identify a cell's value by it's row and column name.\n\n## Simple Table\n\nA simple example with no frills.\n\n{{\"demo\": \"pages/components/tables/SimpleTable.js\", \"bg\": true}}\n\n## Dense Table\n\nA simple example of a dense table with no frills.\n\n{{\"demo\": \"pages/components/tables/DenseTable.js\", \"bg\": true}}\n\n## Sorting & Selecting\n\nThis example demonstrates the use of `Checkbox` and clickable rows for selection, with a custom `Toolbar`. It uses the `TableSortLabel` component to help style column headings.\n\nThe Table has been given a fixed width to demonstrate horizontal scrolling. In order to prevent the pagination controls from scrolling, the TablePagination component is used outside of the Table. (The ['Custom Table Pagination Action' example](#custom-table-pagination-action) below shows the pagination within the TableFooter.)\n\n{{\"demo\": \"pages/components/tables/EnhancedTable.js\", \"bg\": true}}\n\n## Customized tables\n\nHere is an example of customizing the component. You can learn more about this in the\n[overrides documentation page](/customization/components/).\n\n{{\"demo\": \"pages/components/tables/CustomizedTables.js\", \"bg\": true}}\n\n### Custom pagination options\n\nIt's possible to customise the options shown in the \"Rows per page\" select using the `rowsPerPageOptions` prop.\nYou should either provide an array of:\n\n- **numbers**, each number will be used for the option's label and value.\n\n  ```jsx\n  <TablePagination rowsPerPageOptions={[10, 50]} />\n  ```\n- **objects**, the `value` and `label` keys will be used respectively for the value and label of the option (useful for language strings such as 'All').\n\n  ```jsx\n  <TablePagination rowsPerPageOptions={[10, 50, { value: -1, label: 'All' }]} />\n  ```\n\n### Custom pagination actions\n\nThe `Action` property of the `TablePagination` component allows the implementation of\ncustom actions.\n\n{{\"demo\": \"pages/components/tables/CustomPaginationActionsTable.js\", \"bg\": true}}\n\n## Fixed header\n\nAn example of a table with scrollable rows and fixed column headers.\nIt leverages the `stickyHeader` prop ( no IE 11 support).\n\n{{\"demo\": \"pages/components/tables/StickyHeadTable.js\", \"bg\": true}}\n\n## Spanning Table\n\nA simple example with spanning rows & columns.\n\n{{\"demo\": \"pages/components/tables/SpanningTable.js\", \"bg\": true}}\n\n## Virtualized Table\n\nIn the following example, we demonstrate how to use [react-virtualized](https://github.com/bvaughn/react-virtualized) with the `Table` component.\nIt renders 200 rows and can easily handle more.\nVirtualization helps with performance issues.\n\n{{\"demo\": \"pages/components/tables/ReactVirtualizedTable.js\", \"bg\": true}}\n\n## Complementary projects\n\nFor more advanced use cases you might be able to take advantage of:\n\n### material-table\n\n![stars](https://img.shields.io/github/stars/mbrn/material-table.svg?style=social&label=Stars)\n![npm downloads](https://img.shields.io/npm/dm/material-table.svg)\n\n[material-table](https://github.com/mbrn/material-table) is a simple and powerful Datatable for React based on Material-UI Table with some additional features.\nThey support many different use cases (editable, filtering, grouping, sorting, selection, i18n, tree data and more). You should check it out.\n\n{{\"demo\": \"pages/components/tables/MaterialTableDemo.js\", \"bg\": true}}\n\n### Other\n\n- [dx-react-grid-material-ui](https://devexpress.github.io/devextreme-reactive/react/grid/): A data grid for Material-UI with paging, sorting, filtering, grouping and editing features ([paid license](https://js.devexpress.com/licensing/)).\n- [mui-datatables](https://github.com/gregnb/mui-datatables): Responsive data tables for Material-UI with filtering, sorting, search and more.\n- [tubular-react](https://github.com/unosquare/tubular-react): A Material-UI table with local or remote data-source. Featuring filtering, sorting, free-text search, export to CSV locally, and aggregations.\n\n## Accessibility\n\n(WAI tutorial: https://www.w3.org/WAI/tutorials/tables/)\n\n### Caption\n\nA caption functions like a heading for a table. Most screen readers announce the content of captions. Captions help users to find a table and understand what its about and decide if they want to read it.\n\n{{\"demo\": \"pages/components/tables/AcccessibleTable.js\", \"bg\": true}}\n"

