module.exports = "---\ntitle: Componente React Tabelas\ncomponents: Table, TableBody, TableCell, TableContainer, TableFooter, TableHead, TablePagination, TableRow, TableSortLabel\n---\n\n# Table (tabela)\n\n<p class=\"description\">Tables display sets of data. Eles podem ser totalmente customizadas.</p>\n\n[Tables](https://material.io/design/components/data-tables.html) display information in a way thats easy to scan, so that users can look for patterns and insights. Elas podem ser incorporadas no contedo principal, assim como Cartes.\n\nTables can include:\n\n- Uma visualizao correspondente\n- Navegao\n- Ferramentas para consultar e manipular dados\n\nAo incluir ferramentas, elas devem ser colocadas diretamente acima ou abaixo da tabela.\n\n## Estrutura\n\nUma tabela de dados contm uma linha de cabealho no topo que lista os nomes das colunas, seguidas pelas linhas dos dados.\n\nCaixas de seleo devem acompanhar cada linha se o usurio precisar selecionar ou manipular dados.\n\nPara acessibilidade, a primeira coluna  ajustada para ser um elemento `<th>`, com um `escopo` de `\"linha\"`. Isso permite que os leitores de tela identifiquem o valor de uma clula por seu nome de linha e coluna.\n\n## Tabela Simples\n\nUm exemplo simples sem frescuras.\n\n{{\"demo\": \"pages/components/tables/SimpleTable.js\", \"bg\": true}}\n\n## Tabela Densa\n\nUm exemplo simples de uma tabela densa sem frescuras.\n\n{{\"demo\": \"pages/components/tables/DenseTable.js\", \"bg\": true}}\n\n## Classificando & Selecionando\n\nEste exemplo demonstra o uso de linhas clicveis e `Checkbox` para a seleo, com uma barra de ferramentas personalizada `Toolbar`. Ele usa o componente `TableSortLabel` para ajudar no estilo dos cabealhos das colunas.\n\nA tabela recebeu uma largura fixa para demonstrar a rolagem horizontal. Para impedir que os controles de paginao rolem, o componente TablePagination  usado fora da tabela. (O [Exemplo 'da ao de paginao personalizada'](#custom-table-pagination-action) abaixo mostra a paginao dentro de TableFooter.)\n\n{{\"demo\": \"pages/components/tables/EnhancedTable.js\", \"bg\": true}}\n\n## Tabelas Customizadas\n\nAqui est um exemplo de customizao do componente. Voc pode aprender mais sobre isso na [pgina de documentao de sobrescritas](/customization/components/).\n\n{{\"demo\": \"pages/components/tables/CustomizedTables.js\", \"bg\": true}}\n\n### Custom pagination options\n\nIt's possible to customise the options shown in the \"Rows per page\" select using the `rowsPerPageOptions` prop. You should either provide an array of:\n\n- **numbers**, each number will be used for the option's label and value.\n    \n    ```jsx\n    <TablePagination rowsPerPageOptions={[10, 50]} />\n    ```\n\n- **objects**, the `value` and `label` keys will be used respectively for the value and label of the option (useful for language strings such as 'All').\n    \n    ```jsx\n    <TablePagination rowsPerPageOptions={[10, 50, { value: -1, label: 'All' }]} />\n    ```\n\n### Custom pagination actions\n\nA propriedade `Action` do componente `TablePagination` permite a implementao de aes customizadas.\n\n{{\"demo\": \"pages/components/tables/CustomPaginationActionsTable.js\", \"bg\": true}}\n\n## Cabealho fixo\n\nUm exemplo de uma tabela com linhas rolveis e cabealhos de coluna fixos. Ele aproveita do suporte de `stickyHeader` ( sem suporte ao IE 11).\n\n{{\"demo\": \"pages/components/tables/StickyHeadTable.js\", \"bg\": true}}\n\n## Tabela de abrangncia\n\nUm exemplo simples com abrangncia de linhas & colunas.\n\n{{\"demo\": \"pages/components/tables/SpanningTable.js\", \"bg\": true}}\n\n## Tabela Virtualizada\n\nNo exemplo a seguir, ns demonstramos como usar [react-virtualized](https://github.com/bvaughn/react-virtualized) com o componente `Table`. Ela renderiza 200 linhas e pode facilmente lidar com mais. A virtualizao ajuda a lidar com problemas de desempenho.\n\n{{\"demo\": \"pages/components/tables/ReactVirtualizedTable.js\", \"bg\": true}}\n\n## Projetos Complementares\n\nPara usos mais avanados, voc pode tirar vantagem com:\n\n### material-table\n\n![estrelas](https://img.shields.io/github/stars/mbrn/material-table.svg?style=social&label=Stars) ![npm downloads](https://img.shields.io/npm/dm/material-table.svg)\n\n[material-table](https://github.com/mbrn/material-table)  uma tabela de dados simples e poderosa para React baseado na tabela do Material-UI com alguns recursos adicionais. Eles suportam muitos formas de utilizao (edio, filtragem, agrupamento, ordenao, seleo, i18n, rvore de dados e muito mais). Voc deveria dar uma olhada.\n\n{{\"demo\": \"pages/components/tables/MaterialTableDemo.js\", \"bg\": true}}\n\n### Outros\n\n- [dx-react-grid-material-ui](https://devexpress.github.io/devextreme-reactive/react/grid/) Uma grade de dados para Material-UI com paginao, ordenao, filtragem, agrupamento e funes de edio.([Com licenciamento de uso pago](https://js.devexpress.com/licensing/)).\n- [mui-datatables](https://github.com/gregnb/mui-datatables): Tabelas de dados responsivas para Material-UI com filtro, ordenao, pesquisa e muito mais.\n- [tubular-react](https://github.com/unosquare/tubular-react): Uma tabela de Material-UI com fonte de dados local ou remota. Com filtragem, classificao, pesquisa de texto livre, exportao para CSV localmente e agregaes.\n\n## Acessibilidade\n\n(WAI tutorial: https://www.w3.org/WAI/tutorials/tables/)\n\n### Caption\n\nA caption functions like a heading for a table. Most screen readers announce the content of captions. Captions help users to find a table and understand what its about and decide if they want to read it.\n\n{{\"demo\": \"pages/components/tables/AcccessibleTable.js\", \"bg\": true}}"

